import React from "react";

function PasswordRepeat(props) {
  return (
    <div>
      <div>
        Пароль еще раз {" "}
      </div>
      <div>
        <input type="password" placeholder="Пароль" name="twoPassword" value={props.value} onChange={props.onChange}/>
      </div>
    </div>
  )
}

export default PasswordRepeat
